import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Typography from '../components/Typography';

const styles = theme => ({
	root: {
		display: 'flex',
		overflow: 'hidden',
		backgroundColor: theme.palette.secondary.light,
	},
	container: {
		marginTop: theme.spacing(10),
		marginBottom: theme.spacing(10),
		display: 'flex',
		position: 'relative',
	},
	item: {
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		padding: theme.spacing(0, 5),
	},
	image: {
		height: 55,
	},
	title: {
		marginTop: theme.spacing(5),
		marginBottom: theme.spacing(5),
	},
	curvyLines: {
		pointerEvents: 'none',
		position: 'absolute',
		top: -180,
	},
});

function ProductValues(props) {
	const { classes } = props;

	return (
		<section className={classes.root}>
			<Container className={classes.container}>
				<img
					src="/static/assets/productCurvyLines.png"
					className={classes.curvyLines}
					alt="curvy lines"
				/>
				<Grid container spacing={5}>
					<Grid item xs={12} md={4}>
						<div className={classes.item}>
							<img
								className={classes.image}
								src="/static/assets/icons/hot.png"
								alt="temp"
							/>
							<Typography variant="h6" className={classes.title}>
								Temperature
              				</Typography>
						</div>
					</Grid>
					<Grid item xs={12} md={4}>
						<div className={classes.item}>
							<img
								className={classes.image}
								src="/static/assets/icons/water.png"
								alt="humidity"
							/>
							<Typography variant="h6" className={classes.title}>
								Humidity
              				</Typography>
						</div>
					</Grid>
					<Grid item xs={12} md={4}>
						<div className={classes.item}>
							<img
								className={classes.image}
								src="/static/assets/icons/sun.png"
								alt="light"
							/>
							<Typography variant="h6" className={classes.title}>
								Light Intensity
              				</Typography>
						</div>
					</Grid>
				</Grid>				
			</Container>
			{/* <Typography>
				Sprout is a low-cost Internet-of-Things device that aims to help you be a better plant owner! 
				Using embedded sensors and a wifi-chip, Sprout outputs real-time data to a simple web application 
				that lets you determine if a given spot is a good place to grow a plant.
			</Typography> */}
		</section>
	);
}

ProductValues.propTypes = {
	classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(ProductValues);
